const MyIcon = (props) => {
    const {type} = props;
    if(type === "i-dashboard"){
        return <DashboardIcon {...props} />;
    }
    else if(type === "i-school"){
        return <SchoolIcon {...props} />;
    }
    else if(type === "i-gkbk"){
        return <GongKaoBaiKeIcon {...props} />;
    }
    else if(type === "i-class"){
        return <ClassIcon {...props} />;
    }
    else if(type === "i-teacher"){
        return <TeacherIcon {...props} />;
    }
    else if(type === "i-xibanqiu"){
        return <XibanqiuIcon {...props} />;
    }
    else if(type === "i-online"){
        return <OnlineIcon {...props} />;
    }
    else{
        return <ZiliaoIcon {...props} />;
    }
}

export default MyIcon;
